import React from 'react';
import axios from 'axios'



export default class Main extends React.Component {

    constructor(props) {
        super(props)

        this.state= {
            allCourses: []

        }
    }

    componentDidMount(){
        axios.get('https://saral.navgurukul.org/api/courses')
        .then(posRes => {
            const allCourses = posRes.data.availableCourses
            // console.log(allCourses,"poooooooo")
            this.setState({allCourses:allCourses});
        })
        .catch(errRes=>{
            console.log('errRes')

        })
    }


    render() {
        console.log(this.state.allCourses,"32")

